const initState = {}
const projectReducer = (state = initState, action) => {
    switch (action.type) {
        case 'STORE_HTTPDATA':
            console.log('created project', action.newHttpData);
            return state;
        case 'STORE_HTTPDATA_ERROR':
            console.log('create project err', action.err);
            return state;
        default:
            return state;
    }
};

export default projectReducer;
